import React from 'react';
import './Welcome.css';

function Welcome({ onEnter }) {
  return (
    <div
      className="ouverture"
      style={{
        background: `url(${process.env.PUBLIC_URL + '/ab.png'}) center/cover no-repeat`
      }}
    >
      <h1>Bienvenue !</h1>
      <button className="btn" onClick={onEnter}>
        Entrer sur le site
      </button>
    </div>
  );
}

export default Welcome;
